import { User, ChatRoom, ChatContent } from '../model';
import bcrypt from 'bcrypt';
import jwt from 'jsonwebtoken';

export const checker = (req, res) => {
  return res.status(200).json({
    success: true,
    message: 'nice'
  });
};

export const signup = (req, res) => {
  const { email, name } = req.body;
  const password = bcrypt.hashSync(req.body.password, 10);
  return User.sync({ force: true })
    .then(() => {
      return res.status(200).json({
        success: true,
        message: 'signup is successfully',
        data: User.create({email, name, password})
      });
    })
    .catch(err => {
      return res.status(400).json({
        success: false,
        message: err.message
      });
    });
};

export const login = (req, res) => {
  User.findOne({ where: { email: req.body.email } })
    .then(userInfo => {
      if (!userInfo) {
        return res.status(400).json({
          success: false,
          message: "email is not correct"
        });
      }
      const valid = bcrypt.compareSync(req.body.password, userInfo.password);
      if (valid) {
        const payload = {
          id: userInfo.id
        };
        const token = jwt.sign(payload, 'secretjwt', { expiresIn: '30d' });
        return res.status(200).json({
          success: true,
          message: "signin successfully",
          data: token
        });
      } else {
        res.status(400).json({
          success: false,
          message: 'password is not correct'
        });
      }
    })
    .catch(err => {
      res.status(400).json({
        success: false,
        message: err.message
      });
    });
};

