export const createChatContent = (req, res) => {

  ChatContent.sync({ force: true })
    .then(() => {
      console.log('this is your Chat Room');
      return ChatContent.create(req.body);
    })
    .catch(err => {
      console.log('failed create tabel', err.message);
      return err;
    });
};

